import  React, {Component} from 'react';
import axios from 'axios';
import ProjectTableRow from './cusProjectTableRow';

import './css/cusViewProject.css';
import zoo from './img/zoo.png'

export default  class cusViewProject extends  Component{


    constructor(props) {
        super(props);
        this.state = {projects : []};
    }

    onChangeSearch(e){
        this.setState( {
           search: e.target.value
        });

    }

    componentDidMount() {
        axios.get('http://localhost:4000/zoo/project/')
            .then(response => {
                this.setState({projects : response.data});

            })
            .catch(function (error){
                console.log(error);
            })
    }

    tabRow(){
        return this.state.projects.map(function (object, i){
            return <ProjectTableRow obj = {object} key = {i}/>;
        });
    }

    render() {
        return(
            <div className='cusview'>
                <div className='top'>
                    <div className='tittle'>
                           <h2>Animal Haven</h2>
                    </div>
                    <div className='item'>
                        <ul>
                            <li><a href = "">Home</a></li>
                            <li><a href = "">Booking</a></li>
                            <li><a href = "">Animals</a></li>
                            <li><a href = "">Zoo Projects</a></li>
                            <li><a href = "">Contact Us</a></li>
                            <li><a href = "">About Us</a></li>
                            <li><a href = "">Profile</a></li>
                        </ul>
                    </div>
                </div>
                <br/><br/>
                <div className='row'>
                    <div className="col">
                        <center>
                            <img src = {zoo} width="400"/>
                            <br/><br/>
                            <h3>Zoo Projects</h3>
                            <p>You can add new project</p>
                        </center>
                    </div>
                    <div className="col">
                        <center>
                            <h3><a></a>Zoo Projects</h3>
                        </center>
                    </div>
                </div>
            </div>
        );
    }
}
